import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 八·六丁日辛丑时断</p><p>（以下六丁日所忌月分同上，时忌无论）</p><p>六丁日生时辛丑，库中财谷多陈朽；身无依倚不为凶，有托妻贤而富厚。</p><p>丁日辛丑时，丑为财库，辛为妻财，已为食神，丑旺金局，暗己得位，丁火无气，若失天时无倚托者，就妻而发；有倚托救助者，财食丰足。</p><p>丁丑日辛丑时，申酉月，财格，财旺生官，贵。</p><p>午月，伤财身旺，主官禄。</p><p>纯子寅，武贵三品。</p><p>水月，艰辛劳苦。</p><p>辰月贵戚。</p><p>丁卯日辛丑时，辰巳未年月，富贵，妻子迟。</p><p>寅卯印助，戌库身旺，刑。</p><p>丑丁，得倚托，大贵。</p><p>丁巳日辛丑时，因阴人致贵。</p><p>巳酉丑申年月，财旺生官，富贵。</p><p>卯月平常，行此运亦贵。</p><p>丑月，西南运，大贵。</p><p>丁未日辛丑时，时日并冲，忧伤妻子。</p><p>酉月，通水气，吉。</p><p>岁运同。</p><p>丁酉日辛丑时，寅卯巳午，身旺有托，主文名高贵，宠遇非常。</p><p>申酉戌，财旺从之，最吉。</p><p>亥子，官旺亦吉。</p><p>丁亥日辛丑时，春印绶，吉，秋生，有火气亦吉，夏太旺，凶。</p><p>冬官煞旺，吉。</p><p>未戌月，冲开丑库，富。</p><p>辛丑遇丁为宝库，柱无匙钥难言富；刑冲运至遇高人，发迹他乡名誉着。</p><p>丁日时逢辛丑，偏财库喜刑冲。</p><p>若还不显有虚名，妻子宜尔相庆。</p><p>父母雁行难睦，家门换改重新。</p><p>发财发福见中兴，必是荣华之命。</p>",30),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","205卷 八·六丁日辛丑时断（以下六丁日所忌月分同上，时忌无论）.html.vue"]]);export{f as default};
